import React from 'react';
import Skeleton, { SkeletonTheme } from 'react-loading-skeleton';

const SkeletonComp = () => {
	return (
		<div>
			<SkeletonTheme color={'#333'} highlightColor={'#555'}>
				<Skeleton count={2} height={'323px'} width={'323px'} />
				<Skeleton count={2} height={'40px'} width={'323px'} />
				<Skeleton count={2} height={'20px'} width={'323px'} />
			</SkeletonTheme>
		</div>
	);
};

export default SkeletonComp;
